INSERT INTO `faq` (`id`, `title`, `text`, `status`, `created_at`, `updated_at`) VALUES (1,'А скрипты не паблик?','Некоторые скрипты(в данный момент их нет) были взяты из публичного доступа или же были куплены в других магазинах. НО! У нас есть человек, который всё перерабатывает/добавляет и устраняет все проблемы.',1,'2019-08-23 13:19:12',NULL),(2,'Товар не работает, что делать?','Напишите нам в поддержку: vk.com/webgamestore',1,'2019-08-23 13:19:12',NULL),(3,'Оплата не работает, что делать?','Напишите в поддержку',1,'2019-08-23 13:19:12',NULL);
