INSERT INTO `news` (`id`, `title`, `image`, `description`, `status`, `created_at`, `updated_at`) VALUES (1,'Открытие сайта','https://itllc.ru/upload/iblock/360/3604c32cdcd6a004ce8c808ff7318281.jpg','Скоро состоится открытие нашего сайта. Дата открытия будет известна позже',1,'2019-08-23 13:19:12','2019-10-15 18:20:07'),(2,'Активная разработка','http://нипигорногодела.рф/upload/medialibrary/8d6/8d6600508b0f7d6241047ccd77c7a510.jpg','Мы ведем активную разработку сайта. Ожидайте новостей.',1,'2019-08-29 22:55:00','2019-08-29 22:55:28'),(3,'Открытие','http://martmebel.ru/upload/iblock/7a5/7a55e887b986270c441d805834c2afba.png','Сайт полностью готов. Готовимся к открытию',1,'2019-10-15 19:09:24','2019-10-15 19:09:24'),(4,'WEBGAMESTORE и Команда','https://i.imgur.com/juvK6uq.png','Ну началось !!! \r\n\r\nДавно хотелось познакомиться но все как то не получалось....... НО теперь мы готовы! \r\n\r\nНебольшое предисловие:\r\n\r\nМы лично считаем что Команда одна из самых главных показателей любой сферы и залог успеха всего и вся!  И мы рады бороться за ваше вас и вообще доверие!\r\n\r\nИ так Здравствуй!\r\n\r\nЛоготипы:\r\n\r\nLogo maker - общий стаж работы не считая высшего учебного заведения более 10 лет !!!\r\nОпыт работы с такими клиентами как:\r\n- МКБ (Московский кредитный банк)\r\n- Гос. учреждения\r\n- Гос. тендеры\r\n- Онлайн кинотеатр (deep.movie)\r\n- Личные бренды\r\n\r\nДизайн:\r\n\r\nMotion design, WEB и не только!\r\n\r\nОпыт работы более 7 лет, опыт на рынке более 5! \r\n\r\nВладения технологиями как:\r\n- UI | UX \r\n- 3D MAX \r\n- Figma\r\n- Sketch\r\nИ многие другие !!!\r\n\r\nFront-end (фронт)\r\n\r\nТут аж целых 4 мастера спешащих вам помочь !!!\r\n\r\n- Junior Developer\r\n- Middle  Developer\r\n- Midle++ Developer\r\n- Senior Developer\r\n\r\nОпыт и стаж этих людей начинается от 2 лет до 8 🤗\r\n\r\nВладеют такими технологиями работы как:\r\n- HTML5\r\n- CSS3\r\n- W3C\r\n- jQuery\r\n- Bootstrap \r\n- JavaScript\r\n- Vue.js\r\n- React.js\r\n- Meteor.js\r\n\r\nА так же:\r\n⚙️Адаптивность\r\n⚙️Минимум кода\r\n⚙️Высокая скорость загрузки страниц\r\n⚙️Семантичность\r\n⚙️Валидность\r\n\r\nBack-end (Бэк)\r\n\r\nА тут у нас все серьёзнее и кропотливее.... 3 специалиста высшего уровня к вашему распоряжению  !!!\r\n\r\n- Middle Devloper\r\n- Middle++ Developer\r\n- Senior Developer\r\n\r\nОпыт и стаж этой  «троицы» начинается от 5 лет до 8 🤝\r\n\r\nВлюблены в  своих «любимых»  :\r\n\r\n- PHP\r\n- Laravel\r\n- Phalcon\r\n- RUBY\r\n- Phyton\r\n- C#\r\nА так же:\r\n🔧 SQL\r\n🔧 Mysqli\r\n🔧Mongo\r\n🔧XML \r\n\r\nИ многие другие!!!\r\n\r\nПродвижение:\r\n\r\n👑Маркетолог/Таргетолог/SMM - этот человек дела знающий и любящий свою работу и дело жизни !!! \r\n\r\nОпыт работы как с рекламными агенствами так и с любыми типами социальных сетей🌟\r\n\r\nВладеющий такими технологиями и знаниями как:\r\n\r\n- Таргетированная  реклама\r\n- Ретаргетинг\r\n- Гео таргет\r\n- SEO\r\n- SMM\r\n- Нейромаркетинг\r\n\r\nИндивидуальный подход к каждому и нахождение в любых ситуаций истинного пути и решения любых проблем 😊',1,'2019-10-25 08:18:08','2019-10-25 09:04:01');
