INSERT INTO `products` (`id`, `title`, `description`, `image`, `price`, `category_id`, `purchases`, `download_link`, `download_pass`, `status`, `created_at`, `updated_at`) VALUES (1,'Скрипт рулетки Dragonmoney с админкой','Скрипт рулетки Dragonmoney с админкой - отличный выбор для бюджетного сайта. Пофикшены баги, изменили дизайн.\r\nРежимы: Jacpot (Три команты, которые настраиваются в админке)\r\n\r\nDouble (Настраивается в админке, имеется подкрутка)\r\n\r\nPVP (Создаются комнаты игроками, и играют между собой)\r\n\r\nИгровой режим crash бета версия.\r\n\r\nВ товар входит оригинальный скрипт лайв-лото, с фиксами и работоспособными функциями, с полной админкой.\r\n\r\nВ инструкции будет указаны все детали, касательно настройки скрипта, подключение базы, настройка серве','https://i.imgur.com/YontINF.jpg',2000.00,1,0,'https://yadi.sk/d/nOUXcuuA39CBJQ',NULL,1,'2019-08-24 12:42:06','2020-01-31 07:16:44'),(2,'Скрипт уникальной рулетки KPDBET','Скрипт уникальной рулетки KPDBET -  kpdbet.com \r\n\r\nОписание скрипта:\r\n\r\nFront-end\r\nVue.js\r\nNode.js (express)\r\njQerly\r\n\r\nBack-end\r\nNode.js\r\nLaravel\r\nAngularJS\r\nPHP\r\nsocket\r\n\r\nРежимы игры:\r\n\r\nCRASH -\r\n1.Полностью рабочий анимированно краш.\r\n2.Присутствуют все необходимые звуки.\r\n3.Возможность подкрутки.\r\n4.Возможность CASHOUT.\r\n5.В блоках показан последний «Х» краша, с последующими изменениями «Х» раундов.\r\n\r\nDICE -\r\n1.Анимированный прирост/убывание % на победу умножение X.\r\n2.История ставок\r\n3.Общая история кол-вк ставок.\r\n4.На гл','https://i.imgur.com/3eWUAnR.jpg',5000.00,1,0,NULL,NULL,1,'2019-08-24 12:44:18','2019-10-24 14:26:26'),(3,'Скрипт сайта PAPA.MONEY FULL','Скрипт сайта PAPA.MONEY FULL\r\n\r\nОчень большой функционал в Админ-панели.\r\nДержит большой онлайн.\r\nЕсть системы \"Анти-минус\", уникальные для каждой игры.\r\n\r\nСкрипта нет в паблике, все системы написаны с нуля.\r\n\r\nИгры\r\n- CRASH\r\n- DOUBLE\r\n- DICE\r\n- JACKPOT\r\n- PVP\r\n- BATTLE\r\n- LOTTERY