ус за привязку;\r\nЕжедневный бонус;\r\nВосстановление пароля;\r\nБаланс Фрикассы;\r\nПодтверждение почты (защита от фейков, твинков) (В админке можно выключить если не надо);\r\nБолее доскональное взаимодействие с пользователями (В админке);\r\nИзменение (Названия сайта, Валюты, Футера, Ключа','https://i.imgur.com/gvY1RYw.jpg',2790.00,1,0,'https://yadi.sk/d/pltpPGsa5Ihntw',NULL,1,'2019-10-07 06:43:00','2019-10-21 05:09:55'),(45,'Скрипт SPIN MONEY','Скрипт SPIN MONEY\r\n\r\nВ движке присутствует регулировка шанса окупаемости кейсов, реферальная система, админ-панель сайта, режим ютубера.\r\nПополнение баланса происходит через платежную систему: Free-Kassa.\r\nАвторизация через социальную сеть: Вконтакте.','https://i.imgur.com/wZUq1RG.jpg',1390.00,1,0,'https://yadi.sk/d/HPmaZbr3y2gU6g',NULL,1,'2019-10-07 06:43:47','2019-10-21 05:10:26'),(46,'Скрипт FAST-LOTO','Новая версия Скрипт FAST-LOTO!\r\n\r\nДобавлено в 4 версии:\r\nНовый дизайн;\r\nПромо-коды;\r\nФункции в Config;\r\n\r\nДобавлено в 3 версии:\r\n\r\nКомната \"Больше или Меньше\". (Что-то типо NVUTI)\r\nПользователь указывает размер ставки, шанс выигрыша, выбирает промежуток больше или меньше.\r\nЗаранее генерируется число от 0 до 99 999\r\nЕсли число находится в пределах диапазона, который он выбрал, то выигрывает.\r\nЕсли проигрывает, то часть денег идёт в кассу, часть трём его спонсорам (рефоводам) и админу .\r\nУ модуля есть своя касса, которая не работае','https://i.imgur.com/gYqITpU.jpg',1090.00,1,0,'https://yadi.sk/d/fIib4_gqhDd3-A',NULL,1,'2019-10-07 06:44:27','2019-10-21 05:10:53'),(47,'Скрипт BANG CASH','Новый Скрипт BANG CASH открытия кейсов на деньги, написанный полностью на фреймворке laravel.\r\n\r\nПомимо стандартных функций открывания кейсов, в скрипте присутствуют такие функции как:\r\n\r\nБесплатный бонусный кейс, который можно открывать раз в сутки; Бонусы за пополнение баланса;Промокоды, которые Вы можете генерировать в админке;\r\n\r\nРабочая регулировка шансов выпадения дорогих предметов; Режим Ютуберки для большей эффективности рекламы; Красивая и удобная админка, и много-много всего другого.\r\n\r\nТеги: скрипт открытия кейсов, ден','https://i.imgur.com/8q1CEFJ.jpg',490.00,3,0,'https://yadi.sk/d/iSXBEi7fNFGdng',NULL,1,'2019-10-07 06:45:13','2019-10-21 05:11:23'),(48,'Скрипт NVUTI Эконом','Скрипт NVUTI Эконом\r\n\r\nОбновленная версия скама Nvuti, за основу взята версия Nvuti за 4000 руб, но с урезанным функционалом, дыр, багов и шеллов скрипте нет, также выкручен шанс на поражения, 60-70% будут поражения, лицензия в скрипте присутствует, версия VDS.','https://i.imgur.com/Hul8Tn2.jpg',990.00,1,0,'https://yadi.sk/d/pltpPGsa5Ihntw',NULL,1,'2019-10-07 06:45:43','2019-10-21 05:11:51'),(49,'Скрипт BATTLE.CASH','Скрипт BATTLE.CASH\r\n\r\nСкрипт полностью уникальный, написан полностью на NodeJS и AngularJS.\r\n\r\nОписание скрипта:\r\n- Авторизация через vk, odnoklassniki.\r\n- Выбор победителя происходит через генератор случайных чисел Random.org.\r\n- Ежедневный бонус для подписчиков группы.\r\n- Личный кабинет с подробной статистикой пользователя\r\n- Привилегии (Администратор, премиум и вип).\r\n- Чат с функцией удаления сообщений.\r\n- Автоматическая система выводов.\r\n- Система оплаты FreeKassa.','https://i.imgur.com/8pVPvKB.jpg',2650.00,1,0,'https://yadi.sk/d/ym19Wf81fMzCeA',NULL,1,'2019-10-07 06:46:50','2019-10-21 05:01:59'),(50,'Услуга \"Настройка скрипта\"','Настройка любых ОС,любых скриптов и внутренней кухни сайта.\r\n\r\nЦена складывается из сложности работ, подробнее уточняйте в поддержке!','https://i.imgur.com/HQ4fncP.jpg',1.00,4,0,NULL,NULL,1,'2019-10-07 07:05:56','2019-10-23 06:16:01'),(51,'Услуга «Дизайн»','Создание любого формата дизайна:\r\n⚙️WAP\r\n⚙️WEB\r\n⚙️Дизайн шапок для групп\r\n⚙️Дизайн сайтов\r\n⚙️Дизайн рулеток\r\n⚙️Дизайн графики\r\n⚙️Логотипы\r\n\r\nP.S Стоимость обговаривается индивидуально в зависимости от сложности работ.','https://i.imgur.com/88qNW7K.jpg',1.00,4,0,NULL,NULL,1,'2019-10-07 07:06:30','2019-10-07 13:16:18')